import React, { Component } from "react";
import { Breadcrumb, Button } from "react-bootstrap"

class Sanitario extends Component {

    componentDidMount() {

    }

    render() {
        return (
            <div>
			<Breadcrumb style={{margin:30}}>
                    <Breadcrumb.Item href="/">SiGeVa</Breadcrumb.Item>
                    <Breadcrumb.Item href="/Sanitario">Sanitario</Breadcrumb.Item>
                </Breadcrumb>
                <div>
                    <h6>Seleccinoa una fecha para ver la lista de vacunacion y pulsa en "Consultar Lista Vacunacion" para ver la lista de ese dia
                    </h6>
                    <a href="/Sanitario/ConsultarListaVacunacion">
                        <Button style={{ marginRight: 15 }}>Consultar Lista Vacunacion</Button>
                    </a>
                </div>
            </div>
        );
    }
}

export default Sanitario
